import React from "react";
import "./style.css";
import "bootstrap/dist/css/bootstrap.css";
import { Link } from "react-router-dom";
export default class Continents extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }

  componentDidMount() {
    document.title = "Home page";
    fetch("http://localhost:4000/api/continents")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        this.setState({
          data: json,
        });
      });
  }
  render() {
    return (
      <div className="container-fluid">
        {this.state.data.map((each) => (
          <div key={each.id}>
            {" "}
            <Link to={`/logs/continents/${each.id}`}>{each.name}</Link>
          </div>
        ))}
        <Link to={`/logs`}>All</Link>
      </div>
    );
  }
}
